import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import User from "./components/Navbar/User";
import Profile from "./components/Profile/Profile";

const App = () => {
    return (
        <div className='app-wrapper'>
            <Header />
            <User />
            <Profile />
        </div>
    );
}

export default App;
